import { SSocketProps } from 'servisofts-socket'
import { SThemeThemes } from 'servisofts-component'
const SThemeProps: SThemeThemes = {
    default: {
        barStyle: "dark-content",
        barColor: "#EDEDED",
        primary: "#ffffff",
        secondary: "#000000",
        background: "#ffffff",
        card: "#bbbbbb99",
        info: "#16BF87"

    },
    dark: {
        barStyle: "light-content",
        barColor: "#161718",
        primary: "#000000",
        secondary: "#ffffff",
        background: "#000000",
        card: "#55555566",
        info: "#0097DA"
    }
}

const SocketProps: SSocketProps = {
    name: 'chat',
    // host: 'calistenia.servisofts.com',
    host: '192.168.3.4',
    port: {
        native: 10009,
        web: 20009,
        http: 30009,
    },
    ssl: false,
    cert: "",
    apis: {
        rp: "https://rolespermisos.servisofts.com/images/"
    }
}
export default {
    SocketProps,
    SThemeProps
}
